2326.body:
You are assigning to a variable whose type `Foo` matches type `Bar` but they both have a property `{0}` whose type is incompatible with each other. For example:

```ts
interface Foo {
  {0}: string
}
interface Bar {
  {0}: number
}
const foo: Foo = { {0}: "" }
const bar: Bar = foo
```

Types `Foo` and `Bar` are structurally equal because they have the same properties. However, they are incompatible because the type of property `{0}` is `string` in `Foo` and `number` in `Bar`.

2327.body:
Types `{1}` and `{2}` have the same property `{0}` but the property `{0}` is prefixed with `?` in type `{1}` which means it may not exist.

For example, the interface `{1}` declares that there is a property `{0}` which can be a `string` or it should not exist in the object:

```ts
interface {1} {
  {0}?: string;
}
interface {2} {
  {0}: string
}
const foo: {1} = {}  // OK: '{0}' doesn't exist in type '{1}'
const bar: {2} = foo // Error: '{0}' must exist in type '{2}'
```

Consider removing the prefix `?` from the property `{0}` in type `{1}` or adding the prefix `?` to the property `{0}` in type `{2}`.

